import React from "react";
import sData from './cardLists';
import Cards from "./Cards";

function Original(){

    return (<Cards
                key={sData[3].key} 
                srcImage={sData[3].srcImage} 
                title={sData[3].title} 
                typeTrend={sData[3].typeTrend}
            />
            
            
            )

}

export default Original;
